    public static long doAlgebra(ArrayList<String> op, ArrayList<Long> operand) {
        long result = operand.get(0);
        for (int i = 0; i < op.size(); i++) {
            long next = operand.get(i+1);
            if (op.get(i).equals("+")) {
                result += next;
            }
            else if (op.get(i).equals("-")) {
                result -= next;
            }
            else if (op.get(i).equals("*")) {
                result *= next;
            }
            else if (op.get(i).equals("//")) {
                result /= next;
            }
            else if (op.get(i).equals("**")) {
                result = (long)Math.pow(result, next);
            }
        }
        return result;

